import React from 'react';

function TemplateShowcase() {
  // Mock dataset for templates
  const templates = [
    {
      id: 1,
      name: 'Template 1',
      screenshotUrl: '/assets/images/template1.png',
    },
    {
      id: 2,
      name: 'Template 2',
      screenshotUrl: '/assets/images/template2.png',
    },
    {
      id: 3,
      name: 'Template 3',
      screenshotUrl: '/assets/images/template3.png',
    },
  ];

  // Handlers for the buttons
  const handleEdit = (templateId) => {
    console.log(`Edit template with ID: ${templateId}`);
    // Redirect to edit template page
  };

  const handlePreview = (templateId) => {
    console.log(`Preview template with ID: ${templateId}`);
    // Show template preview in a modal or navigate to preview page
  };

  return (
    <div className="page-content">
      {/* Page Header */}
      <div className="page-title-box">
        <div className="container-fluid">
          <div className="row align-items-center">
            <div className="col-sm-6">
              <div className="page-title">
                <h4>Template Showcase</h4>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Page Content */}
      <div className="container-fluid">
        <div className="page-content-wrapper">
          <div className="row">
            {/* Template Cards */}
            {templates.map((template, index) => (
              <div className="col-md-4" key={index}>
                <div className="card">
                  <div className="card-body">
                    <div className="template-screenshot">
                      <img
                        src={template.screenshotUrl}
                        alt={`Template ${index + 1}`}
                        className="img-fluid rounded"
                      />
                    </div>
                    <h5 className="mt-3 text-center">{template.name}</h5>
                    <div className="d-flex justify-content-between mt-3">

                      <button
                        className="btn btn-primary"
                        onClick={() => handleEdit(template.id)}
                      >
                        Edit Template
                      </button>
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default TemplateShowcase;
